== 偶像大师音乐配信列表 ==

偶像大师、偶像大师 灰姑娘女孩、偶像大师 百万现场的歌曲，从3月3日开始，在各大音乐配信网站开始配信，每周增加新曲；特别地，2月24日于e-onkyo music先行配信。

每首歌曲价格为540日元（含税）。

